import { ROUTE_CONSTANTS } from "./route-constants";

export const SIDEBAR_CONSTANTS = [
  {
    id: "1",
    text: "Task-1",
    path: ROUTE_CONSTANTS.TASK_1,
  },
  {
    id: "2",
    text: "Task-2",
    path: ROUTE_CONSTANTS.TASK_2,
  },
];
